import './Students.css';

function Students(){
    return(
        <div>
            <table border={1}>
            <thead>
                    <tr>
                        <th>Name</th>
                        <th>Subject</th>
                        <th>Class</th>
                        <th>School Name</th>
                    </tr>
                    <td>
                        <tr>Sanaya</tr>
                        <tr>Anaya</tr>
                    </td>
                </thead>
            </table>
        </div>
    );
}
export default Students;
